// When everything is loaded, change the title of the page to
//   "Foster For Life National Resource Map"
$(function(){
    document.title="Foster For Life National Resource Map";


	function addThreeIcons(sid)
	{
		// data URLs below created from https://thedevband.com/image-to-base64-converter.html
		// ----------------------------------------------------------------------------------
		var fbs='data:image/png;base64,',
			tws='data:image/png;base64,',
			ins='data:image/png;base64,',
			rss='data:image/png;base64,',
            gps='data:image/png;base64,',
			fbl='<a href="https://www.facebook.com/myfosterforlife/" target="_blank"><img src="' + fbs + '"/></a>',
			twl='<a href="https://twitter.com/for_foster" target="_blank"><img src="' + tws + '"/></a>',
			inl='<a href="https://www.instagram.com/foster_for_life/" target="_blank"><img src="' + ins + '"/></a>',
			rsl='<a href="https://www.instagram.com/foster_for_life/" target="_blank"><img src="' + rss + '"/></a>',
			gpl='<a href="https://www.instagram.com/foster_for_life/" target="_blank"><img src="' + gps + '"/></a>',
			ih = fbl+twl+inl+rsl+gpl+sid.innerHTML;
		sid.innerHTML = ih;
	}

	$("#sponsor-links").each(function(i,e){
		addThreeIcons(e);
	});

	$("#manage-links").each(function(i,e){
		addThreeIcons(e);
	});

	$("i.icon.search").hide();
});
